create table ProductScholarshipCountryModifiers
(
    Id               int identity
        constraint PK_ProductScholarshipCountryModifiers
            primary key,
    CreationDate     datetime2 not null,
    ModificationDate datetime2 not null,
    IsDeleted        bit       not null,
    CountryCode      nvarchar(max),
    CategoryUrl      nvarchar(max),
    Value            real      not null,
    IsActive         bit       not null,
    [Order]          int       not null
)
go

